function visitPage(n){makeRequest(`/umbraco/uPersonalize/Personalization/pageVisit/${n}`,"POST")}const makeRequest=(n,t,i=null)=>fetch(n,{method:t,body:i});window.addEventListener("load",function(){var t=this.document.getElementsByClassName("uPersonalizeButton"),n;if(t.length>0)for(n=0;n<t.length;n++)t[n].addEventListener("click",function(){makeRequest(`/umbraco/uPersonalize/Personalization/TriggerEvent/testEvent`,"POST")})});